import React from "react";
import Navbar from "./navbar";

function Product(){
    function handleClick(){
        console.log("clicked");
    }
    return(
        <div>
            <Navbar />
            <img onClick={handleClick} className="icon" src="./icon/filter.png"></img>
        </div>
    )
}

export default Product;
